package com.reference.injection;

public class Roll {
	private String roll;

	public String getRoll() {
		return roll;
	}

	public void setRoll(String roll) {
		this.roll = roll;
	}

	public Roll() {
		super();
		// TODO Auto-generated constructor stub
	}

	@Override
	public String toString() {
		return "Roll [roll=" + roll + "]";
	}
	
	
}
